import { BrowserRouter ,Navigate, Routes, Route } from "react-router-dom";
import { Signup } from "./components/Signup.js";

function Login() {
  return (
    <BrowserRouter>
      <Routes>

          <Route path="/Signup">
            <Signup />
          </Route>
        
      </Routes>
    </BrowserRouter>
  );
}

export default Login;
